    false,nt"url": null,nt"notes": "Continuum of Care (CoC) Homeless Assistance
    Programs Dashboard Reports are available for each CoC and include information on
    each CoCu2019s awards by award amount, program type, and renewal type. The reports
    contain summary data from the Point-in-Time (PIT) count and Housing Inventory Count
    (HIC). They also provide a quick overview of a CoCu2019s performance in serving
    homeless individuals with their CoC awards. Note: This report is based on information
    provided to HUD by CoCs in the CoC application and has not been independently verified
